description:
The blockbusting, color-matching excitement of COLLAPSE! returns with award-winning gameplay, all-new customizable characters, and fantastic foes like the mighty Blocktopus and Blockula! Use explosive power-ups, buy amazing upgrades and bust those blocks!

What's in this version:
New Features:
+ Tablet support
+ Expanded support for higher/lower res devices

